"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[9467],{72764:t=>{t.exports=JSON.parse('{"tag":{"label":"Data fields","permalink":"/tags/data-fields","allTagsPath":"/tags","count":5,"items":[{"id":"kb/data-fields/custom-fields","title":"Custom fields","description":"Fintesk comes with a highly customizable approach to managing your sales process (and in fact, any other process). Your deals, contacts, organizations and products already come with the default fields needed to manage your data, but you can add fields specific to your company\u2019s needs as custom fields.","permalink":"/kb/data-fields/custom-fields"},{"id":"kb/data-fields/data-fields-in-fintesk","title":"Data fields in Fintesk","description":"To keep your data organized and help you focus on information that needs special attention, we created different types of data fields that serve different purposes. You can find your data fields settings by going to Settings > Data fields.","permalink":"/kb/data-fields/data-fields-in-fintesk"},{"id":"kb/data-fields/how-can-i-add-data-fields-to-an-add-deal-contact-or-product-modal","title":"How can I add data fields to an add deal, contact, or product modal?","description":"To add a custom field to your add deal, contact or product modal, go to Company settings > Data fields and select the tab of the entity you want to add the field to.","permalink":"/kb/data-fields/how-can-i-add-data-fields-to-an-add-deal-contact-or-product-modal"},{"id":"kb/importing-data/import-fields","title":"Import fields","description":"When you\u2019re importing spreadsheets into Fintesk, it\u2019s important to know which fields are available for you to move your spreadsheet data into.","permalink":"/kb/importing-data/import-fields"},{"id":"kb/data-fields/what-types-of-custom-fields-are-there","title":"What types of custom fields are there?","description":"Custom fields can be used when the information you want to add to Fintesk doesn\u2019t exist as a default field.","permalink":"/kb/data-fields/what-types-of-custom-fields-are-there"}],"unlisted":false}}')}}]);